import Link from 'next/link';

const Pin = () => (
    <div>
        <ul>
            <li><Link href="/"><a>Home</a></Link></li>
            <li><Link href="/pin"><a>Pin</a></Link></li>
        </ul>

        <h1> Pinning Site </h1>
        <p>Harness the power of IPFS with all the additional functionality you need.</p>
    </div>
);

export default Pin;
